package com.murad.quickcart.random;

import java.util.HashMap;
import java.util.Map;

class Subsequence {
    public boolean isSubsequence(String s, String t) {
        char[] target = t.toCharArray();
        Map<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < t.length(); i++) {
            map.put(target[i], i);
        }

        char[] str = s.toCharArray();
        int curIndex = -1;
        for (int i = 0; i < s.length(); i++) {
            if (map.containsKey(str[i])) {
                int index = map.get(str[i]);
                if (index > curIndex) {
                    curIndex = index;
                } else {
                    return false;
                }
            } else {
                return false;
            }
        }
        return true;
    }


    public static void main(String[] args) {
        Subsequence solution = new Subsequence();

        String s = "leeeeetcode";
        String t = "";
        System.out.println(solution.isSubsequence(s, t));

//        String s = "abc";
//        String t = "ahbgdc";
//        System.out.println(solution.isSubsequence(s, t));  // Output: true

        s = "axc";
        t = "ahbgdc";
        // System.out.println(solution.isSubsequence(s, t));  // Output: false
    }
}



